Therefore, to get amounts right is a task that is up to the programmer largely to get this right. There are a few different amount types to be aware of. u64 represents sats. may be too big! i64 represents sats. may be too small! bitcoin::Amount represents u64, no standard serialization. bitcoin::SignedAmount represents i64, no standard serialization. bitcoin::CoinAmount standard tagged serialization, either u64 or f64. These different types have uses in different circumstances. Because bitcoin::Amount does not have a standard serializer, in order to use it in e.g. a Vec, you have to wrap the type with a a serializer. From impls can make life a little eaiser to work with these. use bitcoin::util::amount::Amount; use schemars::JsonSchema;
use serde::{Deserialize, Serialize}; /// A wrapper around `bitcoin::Amount` to force it to serialize with f64.
#[derive( Serialize, Deserialize, JsonSchema, Clone, Copy, Debug, Ord, PartialOrd, PartialEq, Eq,
)]
#[serde(transparent)]
struct AmountF64( #[schemars(with = "f64")] #[serde(with = "bitcoin::util::amount::serde::as_btc")] Amount,
); impl From<Amount> for AmountF64 { fn from(a: Amount) -> AmountF64 { AmountF64(a) }
}
impl From<AmountF64> for Amount { fn from(a: AmountF64) -> Amount { a.0 }
} CoinAmount does not have this problem, but it can't be used in all contexts, e.g. extenral APIs that aren't tagged.

